  // Loads base64 document in viewer
  // Loads base64 document in viewer
  async insertDocument(file, options) {
    /*
  //optional parameter
    {
    pageFilters: [{"pageNo": 1, "visible": true}]
    }
  */
    this.loadWaitSpinner();

    let inputData = {};
    let fileURL = "";
    let width = "";
    let height = "";
    inputData.file = file[0];
    let selectedOption = { apiName: "insertDocument" };
    let promise = null;
    new Promise((res, rej) => {
      let reader = new FileReader();
      if (file[0].type === "" && file[0].name.split(".").pop() === "msg") {
        reader.readAsArrayBuffer(file[0]);
        reader.onload = async (events) => {
          fileURL = events.target.result;
          inputData.fileUrl = fileURL;
          window.eViewerComponentReference.zone.run(() => {
            promise = window.eViewerComponentReference.invokeAPI(
              selectedOption,
              inputData
            );
          });
        };
      } else if (
        file[0].type === "" &&
        (file[0].name.split(".").pop() === "heic" ||
          file[0].name.split(".").pop() === "heif")
      ) {
        window.eViewerComponentReference.zone.run(() => {
          promise = window.eViewerComponentReference.invokeAPI(
            selectedOption,
            inputData
          );
        });
      } else if (file[0].type === "message/rfc822") {
        reader.readAsText(file[0]);
        reader.onloadend = async (events) => {
          fileURL = events.target.result;
          inputData.fileUrl = fileURL;
          window.eViewerComponentReference.zone.run(() => {
            promise = window.eViewerComponentReference.invokeAPI(
              selectedOption,
              inputData
            );
          });
        };
      } else {
        reader.readAsDataURL(file[0]);
        reader.onload = async (events) => {
          if (options.pageFilters === undefined) {
            options.pageFilters = [];
          }
          fileURL = events.target.result;
          inputData.fileUrl = fileURL;
          inputData.pageFilters = options.pageFilters;
          inputData.saveDocumentEndPoint = options.saveDocumentEndPoint;
          inputData.captionFiles = options.captionMap;
          if (
            file[0].type.includes("video") ||
            file[0].type.includes("audio")
          ) {
            if (file[0].type.includes("video")) {
              //Aqil => Generic_eVewer7_3941: Audio/Video : S1-P1
              if (file[0].type.includes("avi")) {
                window.eViewerComponentReference.zone.run(() => {
                  promise = window.eViewerComponentReference.invokeAPI(
                    selectedOption,
                    inputData
                  );
                });
              } else {
                fileURL = await this.loadAVFileByURL(file[0]);
                inputData.fileUrl = fileURL;
                const videoElement = document.createElement("video");
                videoElement.src = fileURL;
                videoElement.addEventListener("seeked", () => {
                  const canvas = document.createElement("canvas");
                  const context = canvas.getContext("2d");
                  canvas.width = videoElement.videoWidth;
                  canvas.height = videoElement.videoHeight;
                  context.drawImage(
                    videoElement,
                    0,
                    0,
                    canvas.width,
                    canvas.height
                  );
                  inputData.avWidth = canvas.width;
                  inputData.avHeight = canvas.height;
                  inputData.firstFrameUrl = canvas.toDataURL("image/jpeg");
                  window.eViewerComponentReference.zone.run(() => {
                    promise = window.eViewerComponentReference.invokeAPI(
                      selectedOption,
                      inputData
                    );
                  });
                });

                videoElement.load();
                videoElement.currentTime = 5;
              }
            } else if (file[0].type.includes("audio")) {
              window.eViewerComponentReference.zone.run(() => {
                promise = window.eViewerComponentReference.invokeAPI(
                  selectedOption,
                  inputData
                );
              });
            }
          } else if (
            file[0].type !== "image/jpeg" &&
            file[0].type !== "image/png" &&
            file[0].type !== "image/bmp" &&
            file[0].type !== "image/gif" // nilesh for Generic_eVewer7_2295 & Generic_eVewer7_2296: Regression APINPM:S1,P1
          ) {
            window.eViewerComponentReference.zone.run(() => {
              promise = window.eViewerComponentReference.invokeAPI(
                selectedOption,
                inputData
              );
            });
          }
          let img = new Image();
          img.onload = () => {
            (width = img.width), (height = img.height);
            if (
              file[0].type === "image/jpeg" ||
              file[0].type === "image/png" ||
              file[0].type === "image/bmp" ||
              file[0].type === "image/gif"
            ) {
              inputData.width = width;
              inputData.height = height;
              window.eViewerComponentReference.zone.run(() => {
                promise = window.eViewerComponentReference.invokeAPI(
                  selectedOption,
                  inputData
                );
              });
            }
          };
          img.src = reader.result;
        };
      }
    });

    return await promise;
  }

  loadAVFileByURL(avFile) {
    return new Promise((resolve, reject) => {
      let reader = new FileReader();
      let avFileUrl = null;
      reader.onload = async (event) => {
        const avArrayBuffer = event.target.result;
        const aVBlob = new Blob([avArrayBuffer], { type: "video/mp4" });
        const aVUrl = URL.createObjectURL(aVBlob);
        avFileUrl = aVUrl;
        resolve(avFileUrl);
      };
      reader.readAsArrayBuffer(avFile);
    });
  }

